import React from 'react'

export const Editor = (props) => {


    return (
      <div>
        <h1>Editor</h1>
        <textarea
          name="editor"
          id="editor"
          cols="30"
          rows="10"
          onChange={props.handleChange}
          value={props.input}
        ></textarea>
        <div class="d-inline-flex p-4 bd-highlight">
          I'm an inline flexbox container!
        </div>
      </div>
    );
}
